/* Styles */
import './eventItem.scss';

export function EventItem({ img, eventName, description }) {
    return (
        <div className='eventItem'>
            <img src={img} alt="" />
            <div className='eventContent'>
                <h3>{eventName}</h3>
                <i class="fi fi-sr-chevron-double-up"></i>
                <p>{description}</p>
            </div>
        </div>
    );
}
